import React, { useState } from "react";
import { Link } from "react-router-dom";
import Recrash from "../../public/Recrash.png"
function Navbar(){
  return(
    <nav>
      <img src={Recrash}/>
      <div>
        <h1>Home</h1>
        <h1>Map</h1>
        <h1>About</h1>
      </div>
    </nav>
  )
}
export default Navbar;
